import "./Tarefa.css";

function Tarefa () {
    return (
        <div className="casca-tarefa my-2">
            <h4>Limpar a casa</h4>
            <p>Limpar a casa com vassoura e passar um pano.</p>
            <button className="btn-primary">Feito!</button>
        </div>
    )
}

export default Tarefa;
